import React from 'react';

import "./screen.css";

function Academia({children}) {
    return (
        <div>
            <div className="academia">
            <div className="circulo"/>
            <div className="livro">
            {children.map(child => (child))}
            </div>
            </div>
        </div>
    );
}

export default LayoutAcademia;
